import LogoAsita from '../../assets/svg/logo-asitaaja.svg'
import Products from './Component'

export default class extends React.Component {
  render() {
    return (
      <div>
        <Products image={LogoFlylist} title={'Flylist'} textbutton={'View Product'}/>
      </div>
    )
  }
}
